func Test_numFriendRequests(t *testing.T) {
	ast := assert.New(t)

	for _, tc := range tcs {
		fmt.Printf("~~%v~~\n", tc)
		ast.Equal(tc.ans, numFriendRequests(tc.ages), "输入:%v", tc)
	}
}

func Benchmark_numFriendRequests(b *testing.B) {
	for i := 0; i < b.N; i++ {
		for _, tc := range tcs {
			numFriendRequests(tc.ages)
		}
	}
}
